import React, {Component} from 'react'
import Nav from '../components/nav'
import Demo from '../../shared/Demo'
import { httpGet } from '../../shared/http/httpHandler'
import Sidenav from '../components/sidenav'


class Home extends Component {
  constructor(props) {
    super(props)

    this.state = {
       data:'',
       fatched:false
    }
  }

  getDataFromApi(){
    httpGet('connectionService/getConnections').then(
      result =>
      this.setState({
        data:result,
        fatched:true
      })
      )
  }

  componentDidMount(){
    //this.getDataFromApi()
  }

  render() {
      return (
        <div>
          <Nav/>
          <div style={{display:'flex',flex:3,flexDirection:'row'}}>
          <div style={{width:'10%',height:'100vh',backgroundColor:'red'}}>
            <Sidenav/>
          </div>
          <div style={{display:'flex',justifyContent:'center',alignSelf:'center'}}>
          <div style={{width:'40%',marginTop:'30%'}}> 
          <Demo/>
          </div>
          </div>
          </div>
        </div>
      )
    }
}

export default Home
